import { RadialBarChart, RadialBar, ResponsiveContainer } from "recharts";

import "./RadialBarsChart.css";

function RadialBarsChart() {

    const data = [
        {
            "name": "",
            "uv": 31.47,
            "pv": 2400,
            "fill": "#E60000"
        },
    ];

    return (
        <section className="radialbarchart">
            <p className="radialbarchart-legend">Score</p>
            <div className="barChart-innerlayout">
            <p>12 % <span>de votre objectif</span></p>
            </div>
            <ResponsiveContainer width="100%" height={263}>
            <RadialBarChart
                cx="50%"
                cy="50%"
                innerRadius="65%"
                outerRadius="80%"
                data={data}
                startAngle={95}
                barSize={10}
                endAngle={150}
            >
                <RadialBar
                minAngle={15}
                label={false}
                dataKey="uv"
                cornerRadius={100}
                />
            </RadialBarChart>
            </ResponsiveContainer>
      </section>   
    );
}

export default RadialBarsChart;
